// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./libraries/Structs.sol";
import "./libraries/CallFlags.sol";
import "./interfaces/ISwayCall.sol";
import "./interfaces/ISwayConfig.sol";
import "./interfaces/ISwayCallApp.sol";
import "./interfaces/ISwayCallPay.sol";

import "./libraries/DestChains.sol";
import "./libraries/TypeCasts.sol";

import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable2Step.sol";

contract SwayCall is Context, ISwayCall, Ownable2Step, Pausable {
    using TypeCasts for bytes32;
    using TypeCasts for address;

    uint32 public immutable CHAIN_ID;

    mapping(uint256 => bool) private _executed;

    address payable private _handler;

    ISwayConfig private _swayConfig;
    ISwayCallPay private _swayCallPay;

    event Dispatched(
        uint256 nonce,
        uint32 fromChainId,
        bytes32 fromContractId,
        uint32 destChainId,
        bytes32 destContractId,
        uint256 bridgeFee,
        uint32 slot0U32,
        uint32 slot1U32,
        uint256 slot0U64,
        uint256 slot1U64,
        uint256 slot2U64,
        bytes32 slot0B256,
        bytes32 slot1B256,
        bytes32 slot2B256,
        bytes32 slot3B256
    );

    event SwayExecuted(uint256 nonce);

    constructor(address swayConfig_, address swayCallPay_, uint32 chainId_) Ownable2Step() {
        _swayConfig = ISwayConfig(swayConfig_);
        _swayCallPay = ISwayCallPay(swayCallPay_);
        CHAIN_ID = chainId_;
        _handler = payable(_msgSender());
    }

    function swayDispatch(
        bytes32 destContractId,
        address fromContractId,
        Structs.SCPayloadData calldata data,
        uint32 destChainId,
        uint32 callFlag,
        uint256 receiptId
    ) external payable override whenNotPaused {
        bool validate = _swayConfig.verify(_msgSender(), data);
        require(validate, "INVALID_DISPATCH");

        uint256 nonce = block.timestamp;
        _executed[nonce] = false;

        uint256 bridgeFee = _payFee(
            receiptId,
            callFlag,
            fromContractId,
            destChainId
        );

        emit Dispatched(
            nonce,
            CHAIN_ID,
            fromContractId.addressToBytes32(),
            destChainId,
            destContractId,
            bridgeFee,
            data.slot0U32,
            data.slot1U32,
            data.slot0U64,
            data.slot1U64,
            data.slot2U64,
            data.slot0B256,
            data.slot1B256,
            data.slot2B256,
            data.slot3B256
        );
    }

    function swayExecute(
        Structs.SCPayload calldata payload
    ) external whenNotPaused {
        uint256 nonce = payload.nonce;

        require(!_executed[nonce], "EXECUTE_COMPLETED");

        address destContractId = payload.destContractId.bytes32ToAddress();
        bool validate = _swayConfig.verify(destContractId, payload.data);
        require(validate, "INVALID_EXECUTE");

        ISwayCallApp(destContractId).execute(payload.fromChainId, payload.data);

        _executed[nonce] = true;

        emit SwayExecuted(nonce);
    }

    function _payFee(
        uint256 receiptId,
        uint32 callFlag,
        address contractId,
        uint32 destChainId
    ) internal returns (uint256) {
        if (callFlag == CallFlags.PAY_FROM_SWAYCALL) {
            return _swayCallPay.useReceipt(receiptId, contractId);
        } else {
            uint256 bridgeFee = _swayConfig.swayFee(destChainId);

            if (bridgeFee == 0) return 0;

            require(msg.value >= bridgeFee, "NOT_CALL_ENOUGH_FEE");
            _handler.transfer(bridgeFee);

            return bridgeFee;
        }
    }

    function updateConfig(address config) external {
        _swayConfig = ISwayConfig(config);
    }

    function updateCallPay(address callPay) external {
        _swayCallPay = ISwayCallPay(callPay);
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }
}
